import style from "./Card.module.css";


function Card({ name, species, gender, image, onClose}) {
   return (      
      <div className={style.container}>
         <div>
            <button className={style.buttonClose} onClick={onClose}>X</button>
         </div>
            <img src={image} alt={name} /> 
            <h2>{name}</h2>
            <h2>{species}</h2>
            <h2>{gender}</h2>
      </div>
   );
}

export default Card;
